sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var package = inputs.pre_process_package;
  var selectedServiceOfferings = package.selected_service_offerings;
  var periodOfPerformance = package.period_of_performance;
  // selected services and classification level instances
  var selectedServiceFields = [
    'other_service_offering', 'service_offering', 'classification_instances'
  ];

  if (selectedServiceOfferings) {
	  outputs.selected_service_offerings = getListRecords(
        selectedServiceOfferings.toString(),
        selectedServiceFields,
        'x_g_dis_atat_selected_service_offering')
    	.map(removeSysId)
        .map(getNestedServiceInfo);
  }
  outputs.selected_service_offerings = JSON.stringify(outputs.selected_service_offerings);
  // period of performance mapping
  // mapping of package periods
  outputs.package_periods_by_id = mapPackagePeriods(
    periodOfPerformance.base_period, periodOfPerformance.option_periods
  );
  // array of option periods
  if (periodOfPerformance.option_periods) {
    outputs.package_option_periods = periodOfPerformance
      .option_periods.split(",")
      .map(function(periodId) { return outputs.package_periods_by_id[periodId] });
  } else {
    outputs.package_option_periods = [];
  }

   outputs.package_option_periods = JSON.stringify(outputs.package_option_periods);


})(inputs, outputs);

